@prefix : <http://www.semanticweb.org/ontologies/ecommerce#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecommercePlatform
	a owl:Class ;
	rdfs:label "ecommerce platform"@en .

:user 
	a owl:Class ;
	rdfs:label "user"@en .

:item 
	a owl:Class ;
	rdfs:label "item"@en .

:shoppingCart
	a owl:Class ;
	rdfs:label "shopping cart"@en .

:addToShoppingCart
	a owl:ObjectProperty ;
	rdfs:domain :user ;
	rdfs:range :item ;
	rdfs:label "add to shopping cart"@en .

:haveShoppingCart
	a owl:ObjectProperty ;
	rdfs:domain :user ;
	rdfs:range :shoppingCart ;
	rdfs:label "have shopping cart"@en .

:belongsTo
	a owl:ObjectProperty ;
	rdfs:domain :item ;
	rdfs:range :shoppingCart ;
	rdfs:label "belongs to"@en.

:user 
	a owl:Restriction ;
	owl:onProperty :addToShoppingCart ;
	owl:someValuesFrom :item .

:user 
	a owl:Restriction ;
	owl:onProperty :haveShoppingCart ;
	owl:someValuesFrom :shoppingCart .

:item 
	a owl:Restriction ;
	owl:onProperty :belongsTo ;
	owl:someValuesFrom :shoppingCart .
